import React from 'react';
import './FaceRecognition.css'
const FaceRecognition = ({imageUrl, box}) => {
    return(
        <div className = 'center na'>
            <div className ='absolute mt2'>
                <img id = "inputimage" alt = "face pic" src={imageUrl} width='500px' height='auto'/>
                <div className="bounding-box 01460925-02848382-059291697-06580975" style={{top: box.topRow, right: box.rightCol, bottom: box.bottomRow, left: box.leftCol}}></div>
            </div>
        </div>
    )
}
export default FaceRecognition;
